function Footer() {
  return (
    <footer>
      <nav>
        <a href="/">Home</a>
        <a href="/">Blog</a>
      </nav>
      <p> @ 2024 Dev Diaries by Baily Bates</p>
    </footer>
  );
}

export default Footer;
